import React, { useEffect, useState } from 'react'
import './purchasedStyle.css'
import { AppBar, Button, CssBaseline, Drawer, IconButton, List, ListItem, ListItemIcon, ListItemText, Toolbar, Typography } from '@mui/material'
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import HomeIcon from '@mui/icons-material/Home';
import LogoutIcon from '@mui/icons-material/Logout';
import FavoriteIcon from '@mui/icons-material/Favorite';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css'
import httpService from '../../services/httpService'
import { Box } from '@mui/system';

const Purchased = () =>  {
    const navigate = useNavigate()
    const [isDrawerOpen, setIsDrawerOpen] = useState(false);

    const toggleDrawer = (open) => (event) => {
        if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
        }
        setIsDrawerOpen(open);
    };

    const handleSignOut = () => {
        localStorage.removeItem("token")
        navigate('/')
    }

    useEffect(() => {
        async function fetchMovies() {
          try{
            const response = await httpService.getContents()
            const movies = await response.json()
            setMovies(movies)
          } catch (error) {
            console.error("Erro")
          }
        }
        fetchMovies()
    } , [])

    const list = (
        <Box
            sx={{ width: 250, bgcolor: "primary.main", minHeight: '100vh' }}
            onClick={toggleDrawer(false)}
            onKeyDown={toggleDrawer(false)}   
        >
            <List>
                <ListItem>
                    <Button component={RouterLink} to="/home">
                        <ListItemIcon className='item_icon'>
                            <HomeIcon sx={{color: 'white'}}/>
                        </ListItemIcon>
                        <ListItemText primary="Home" className='text_menu'/>
                    </Button>
                </ListItem>
                <ListItem>
                    <Button component={RouterLink} to="/library">
                        <ListItemIcon className='item_icon'>
                            <FavoriteIcon sx={{color: 'white'}}/>
                        </ListItemIcon>
                        <ListItemText primary="Minha Lista" className='text_menu'/>
                    </Button>
                </ListItem>
                <ListItem>
                    <Button onClick={handleSignOut}>
                        <ListItemIcon className='item_icon'>
                            <LogoutIcon sx={{color: 'white'}}/>
                        </ListItemIcon>
                        <ListItemText primary="Sair" className='text_menu'/>
                    </Button>
                </ListItem>
            </List>
        </Box>
      );
  return (
    <>
        <CssBaseline />
        <AppBar position="fixed">
          <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={toggleDrawer(true)}>
            <MenuIcon />
          </IconButton>
            <Box className='moviePlay'>
                <Typography variant="h6" color="inherit" noWrap className='moviePlay_text'>
                    MoviePlay
                </Typography>
            </Box>
  
            <Box style={{ display: 'flex', alignItems: 'center', marginLeft: 'auto' }}>
                <AccountCircleIcon fontSize='large'/>
            </Box>
          </Toolbar>
        </AppBar>
        <Drawer anchor="left" open={isDrawerOpen} onClose={toggleDrawer(false)}>
            {list}
        </Drawer>

        <main>
          <Box style={{ backgroundColor: 'black', minHeight: '100vh', padding: '20px' }}>
                   
          </Box>
        </main>
        <ToastContainer/>
    </>
  )
}

export default Purchased
